import React from 'react';
import './Emp.css';

const Emp = () => {
  return (
    <div className="container">
      <div className="image-grid">
        <div className="box box1"><img src="C:\Users\ungati_mohith\Downloads\react-website\react-website-v1-master\public\images\img-1.jpg" alt="Image 1" /></div>
        <div className="box box2"><img src="C:\Users\ungati_mohith\Downloads\react-website\react-website-v1-master\public\images\img-1.jpg" alt="Image 2" /></div>
        <div className="box box3"><img src="image3.jpg" alt="Image 3" /></div>
        <div className="box box4"><img src="image4.jpg" alt="Image 4" /></div>
        <div className="box box5">
          <form className="nominee-form">
            <div className="form-group">
              <label htmlFor="nomineeName">Nominee Name</label>
              <input type="text" id="nomineeName" name="nomineeName" required />
            </div>
            <div className="form-group">
              <label htmlFor="relation">Relation</label>
              <input type="text" id="relation" name="relation" required />
            </div>
            <button type="submit" className="submit-button">Add Nominee</button>
          </form>
        </div>
      </div>
    </div>
  );
};

export default Emp;
